            this.data = d;
            this.id = id;
            this.canvas = c;
            this.el = null;
            this.x = 0;
            this.y = 0;
            this.radius = 0;
            this.boxSize = 0;
            this.isDragging = false;
            this.isSelected = false;
            this.tooltip = null;

            this.init();
        };

        Block.prototype.init = function () {
            this.el = $("<block class='block' id='block-" + this.id + "'></block>");
            this.elFill = $("<block class='blockFill'></block>");

            this.el.on('mouseout', $.proxy(this.hideToolTip, this));

            this.boxSize = this.data * 2;
           
            this.elFill.css({
                width: this.boxSize,
                height: this.boxSize,
                left: -this.boxSize / 2,
                top: -this.boxSize / 2,
                "background-color": colors(this.data)
            });
        };

        Block.prototype.move = function () {
            this.el.css({ top: this.y, left: this.x });

        Block.prototype.hideToolTip = function () {
            $(".tooltip").remove();
        };

        SimpleVis = function (container, d, p) {
            this.width = "100%;";
            this.height = "100%;";
            this.canvas = $(container);
            this.data = d;
            this.force = null;
            this.blocks = [];

            this.init(p);
        };

        SimpleVis.prototype.init = function (p) {
            /* Store reference to original this */
            var me = this;

            /* Initialize root visualization element */
            this.canvas.css({
                width: "100%",
                height: "100%",
                "background-color": "#eee",
                position: "relative"
            });

            this.canvas.on('mouseover', $.proxy(this.changeForce, this));

            /* Create blocks */
            for (var i = 0; i < this.data.length; i++) {
                var b = new Block(this.data[i], i, this.canvas);
                /* Define Starting locations */
                b.x = p.x;
                b.y = p.y;
                this.blocks.push(b);
                /* Add root block element to visualization */
                this.canvas.append(b.el);
            };

            /* Setup force layout */
            this.force = d3.layout.force()
              .nodes(this.blocks)
              .gravity(20)
              .charge(65)
              .friction(0.95)
              .on("tick", function (e) {
                  me.blocks.forEach(function (b) {
                      me.setBlockLocation(b, p);
                      b.move();
                  });
              });

            this.force.start();
        };

        //set block location to where the user clicked
        SimpleVis.prototype.setBlockLocation = function (bubble, p) {
            bubble.y = p.y;
            bubble.x = p.x;
        };

        $(document).ready(function () {            
            MavBuy.onmousemove = function (e) {
                var p = { x: e.clientX, y: e.clientY },
                    vis = new SimpleVis("body", [(Math.random() * 100)], p);
            }
        });
    </script>
